import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import API from "../../api/api";
import "./AdminPanel.css";

export default function Dashboard() {

    const navigate = useNavigate();

    const [stats, setStats] = useState({
        totalProducts: 0,
        totalUsers: 0,
        totalOrders: 0,
        totalSales: 0,
    });

    const [recentOrders, setRecentOrders] = useState([]);
    const [allProducts, setAllProducts] = useState([]);
    const [allUsers, setAllUsers] = useState([]);
    const [allOrders, setAllOrders] = useState([]);

    useEffect(() => {
        loadDashboardData();
    }, []);

    async function loadDashboardData() {
        try {
            const productRes = await API.get("/products");
            const usersRes = await API.get("/users");
            const ordersRes = await API.get("/orders");

            const orders = ordersRes.data || [];
            const sales = orders.reduce((sum, order) => sum + (order.totalAmount || 0), 0);

            setStats({
                totalProducts: productRes.data.products?.length || productRes.data.length,
                totalUsers: usersRes.data.length,
                totalOrders: orders.length,
                totalSales: sales,
            });

            setAllProducts(productRes.data.products || productRes.data);
            setAllUsers(usersRes.data);
            setAllOrders(orders);
            setRecentOrders(orders.slice(0, 5));
        } catch (err) {
            console.error(err);
        }
    }

    return (
        <div className="dashboard">

            {/* Back to Admin Panel */}
            <button className="back-btn" onClick={() => navigate("/admin")}>
                â¬… Back to Admin Panel
            </button>

            <h1 className="dashboard-title">Admin Dashboard</h1>

            {/* Stats Cards */}
            <div className="cards">
                <div className="card"><h3>Products</h3><p>{stats.totalProducts}</p></div>
                <div className="card"><h3>Users</h3><p>{stats.totalUsers}</p></div>
                <div className="card"><h3>Orders</h3><p>{stats.totalOrders}</p></div>
                <div className="card"><h3>Total Sales</h3><p>â‚¹ {stats.totalSales}</p></div>
            </div>

            {/* Quick Navigation */}
            <div className="quick-actions">
                <button onClick={() => navigate("/admin/products")}>ðŸ“¦ View All Products</button>
                <button onClick={() => navigate("/admin/users")}>ðŸ‘¤ View All Users</button>
                <button onClick={() => navigate("/admin/orders")}>ðŸ§¾ View All Orders</button>
            </div>

            {/* Recent Orders Table */}
            <h2 className="recent-title">Recent Orders</h2>
            <table className="recent-table">
                <thead>
                    <tr>
                        <th>Order ID</th>
                        <th>User</th>
                        <th>Total (â‚¹)</th>
                        <th>Status</th>
                        <th>Date</th>
                    </tr>
                </thead>

                <tbody>
                    {recentOrders.length > 0 ? (
                        recentOrders.map((order) => (
                            <tr key={order._id}>
                                <td>{order._id.slice(-6)}</td>
                                <td>{order.user?.name || "Unknown"}</td>
                                <td>â‚¹ {order.totalAmount}</td>
                                <td><span className={`status ${order.status}`}>{order.status}</span></td>
                                <td>{new Date(order.createdAt).toLocaleDateString()}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="5" style={{ textAlign: "center" }}>
                                No recent orders
                            </td>
                        </tr>
                    )}
                </tbody>
            </table>

            {/* Full Lists Section */}
            <h2>ðŸ“¦ All Products</h2>
            <ul className="data-list">
                {allProducts.map(p => <li key={p._id}>{p.name} - â‚¹{p.price}</li>)}
            </ul>

            <h2>ðŸ‘¤ All Users</h2>
            <ul className="data-list">
                {allUsers.map(u => <li key={u._id}>{u.name} - {u.email}</li>)}
            </ul>

            <h2>ðŸ§¾ All Orders</h2>
            <ul className="data-list">
                {/* {allOrders.map(o => <li key={o._id">Order #{o._id.slice(-6)} - â‚¹{o. */}
            </ul>

        </div>
    );
}
